function getGraph(a){var t="api.report.php",e=$("#year").val(),o=$("#month").val(),r=$("#line").val();$.ajax({url:t,cache:!1,dataType:"json",type:"GET",data:{calling:"report",action:"getGraph",year:e,month:o,shift:a,line:r},error:function(){console.log("Request Error")}}).done(function(t){$("#container-"+a).highcharts({title:{text:"Shift "+t.data.shift+", Line "+t.data.line+", "+t.data.month+" "+t.data.year,x:-20},xAxis:{categories:t.data.date},yAxis:{title:{text:"%"}},tooltip:{valueSuffix:"%"},series:[{name:"Actual yield",data:t.data.actual_yield},{name:"Taget output",data:t.data.target_output},{name:"Actual output",data:t.data.actual_output},{name:"Product EFF",data:t.data.product_eff},{name:"Total EFF",data:t.data.total_eff}]})}).error()}